/**
 * Player wrapper/helper class 
 */
export class Player extends Events {

/**
 * Creates a new Player object
 * @param {Number} id Internal sa-mp id
 */
	constructor(id){
		super();
/** @type {Number} */
		this.id = id;
/** Cached name
 * @type {String} */
		this.name_ =  "";
/** Cached interior
 * @type {Number} */
		this.interior_ = 0;
/** Cached ip address
 * @type {String} */
		this.ip_ = null;
/** Cached position 
 * @type {Object(x:Number,y:Number,z:Number,a:Number)} */
		this.pos_ = {x:0,y:0,z:0};
/** Cached velocity 
 * @type {Object(x:Number,y:Number,z:Number)} */
		this.velocity_ = {x:0,y:0,z:0};
/** Cached health 
 * @type {Number} */
		this.health_ = 0;
/** Cached armour 
 * @type {Number} */
		this.armour_ = 0;
/** Cached ammo 
 * @type {Number} */
		this.currentAmmo_ = 0;
/** Cached current weapon 
 * @type {Number} */
		this.currentWeapon_ = 0;
/** Cached weapon state 
 * @type {Number} */
		this.weaponState_ = 0;
/** Cached target player 
 * @type {Number} */
		this.targetPlayer_ = 0;
/** Cached weapons 
 * @type {Array} */
		this.weapons_ = [];
/** Cached color 
 * @type {Number} */
		this.color_ = 0;
/** Cached money 
 * @type {Number} */
		this.money_ = 0;
/** Cached skin
 * @type {Number} */
		this.skin_ = 0;
/** Cached score 
 * @type {Number} */
		this.score_ = 0;
/** Cached state 
 * @type {Number} */
		this.state_ = 0;
/** Cached team 
 * @type {Number} */
		this.team_ = 0;
/** Cached wanted level 
 * @type {Number} */
		this.wantedLevel_ = 0;
	}

/**
 * Checks if player is valid
 * @type {Boolean}
 */
	get isValid(){
		return (this.id < 65535);
	}

/**
 * Get player name | GetPlayerName(playerid)
 * @type {String}
 */
	get name(){
		this.name_ = GetPlayerName(this.id);
		return this.name_; 		
	}
/**
 * Set player name | SetPlayerName(playerid, name)
 * @type {String}
 */ 
	set name(name){
		SetPlayerName(this.id, name);
		this.name_ = name;	
	}
/**
 * Get Player IP Address | GetPlayerIp(playerid)
 * @type {String}
 */
	get ip() {
		if(this.ip_ == null) this.ip_ = GetPlayerIp(this.id);
		return this.ip_;
	}
	
/**
 * Get Player Facing Angle | GetPlayerFacingAngle(playerid)
 * @type {Number}
 */
	get facingAngle() {
		this.pos_.a = GetPlayerFacingAngle(this.id);
		return this.pos_.a;
	}

/**
 * Set Player Facing Angle | SetPlayerFacingAngle(playerid, angle)
 * @type {Number} 
 */
	set facingAngle(angle) {
		this.pos_.a = angle;
		SetPlayerFacingAngle(this.id,angle);
	}
	
/**
 * Get Player Position | GetPlayerPos(playerid)
 * @type {Object(x:Number,y:Number,z:Number,a:Number)}
 */ 
	get pos(){
		var tmpp = GetPlayerPos(this.id);
		var tmpa = this.facingAngle;
		this.pos_ = {x: tmpp.x, y: tmpp.y, z: tmpp.z, a: tmpa };
		return this.pos_;
	}
/**
 * Set Player Position. Takes an Object or an Array | SetPlayerPos(playerid, x, y, z )
 * @type {Object(x:Number,y:Number,z:Number,[a:Number])}
 */
	set pos(pos){
		if(Array.isArray(pos)){
			if(pos.length > 3) this.facingAngle = pos[3];
			this.pos_.x = pos[0];
			this.pos_.y = pos[1];
			this.pos_.z = pos[2];
		} else {
			if(pos.hasOwnProperty('a')) this.facingAngle = pos.a;
			this.pos_.x = pos.x;
			this.pos_.y = pos.y;
			this.pos_.z = pos.z;
		}
		SetPlayerPos(this.id,this.pos_.x,this.pos_.y,this.pos_.z);
	}
	
/**
 * Get Player Health | GetPlayerHealth(playerid)
 * @type {Number}
 */ 
	get health(){
		this.health_ = GetPlayerHealth(this.id);
		return this.health_;
	}
/**
 * Set Player Health | SetPlayerHealth(playerid, Float:health)
 * @type {Number}
 */ 
	set health(health){
		this.health_ = health;
		SetPlayerHealth(this.id, this.health_);
	}
	get armour(){
		this.armour_ = GetPlayerArmour(this.id);
		return this.health_;
	}
	set armour(armour){
		this.armour_ = armour;
		SetPlayerArmour(this.id, this.armour_);
	}
	get ammo() {
		this.currentAmmo_ = GetPlayerAmmo(this.id);
		return this.currentAmmo_;
	}
	setAmmo(weaponid,ammo) {
		this.weapons_[weaponid] = ammo;
		SetPlayerAmmo(this.id,weaponid,this.weapons_[weaponid]);
	}
	get weaponState() {
		this.weaponState_ = GetPlayerWeaponState(this.id);
		return this.weaponState_;
	}
	get targetPlayer() {
		this.targetPlayer_ = GetPlayerTargetPlayer(this.id);
		return this.targetPlayer_;
	}
	get team() {
		this.team_ = GetPlayerTeam(this.id);
		return this.team_;
	}
	set team(team) {
		this.team_ = team;
		SetPlayerTeam(this.id,team);
	}
	get interior() {
		this.interior_ = GetPlayerInterior(this.id);
		return this.interior_;
	}
	set interior(interior) {
		this.interior_ = interior;
		SetPlayerInterior(this.id,interior);
	}
	giveWeapon(weaponid,ammo) {
		this.weapons_[weaponid] = ammo;
		GivePlayerWeapon(this.id,weaponid,this.weapons_[weaponid]);
	}
	resetWeapons() {
		for(var i=0;i<47;i++) this.weapons_[i] = 0;
		ResetPlayerWeapons(this.id);
	}
	get weapon() {
		this.currentWeapon_ = GetPlayerWeapon(this.id);
		return this.currentWeapon_;
	}
	set weapon(weaponid) {
		this.currentWeapon_ = weaponid;
		SetPlayerArmedWeapon(this.id,this.currentWeapon_);
	}
	get weaponData() {
		for(var i=0;i<13;i++) {
			var data = GetPlayerWeaponData(this.id,i);
			this.weapons_[data.weapons] = data.ammo;
		}
		return this.weapons_;
	}
	get color() {
		this.color_ = GetPlayerColor(this.id);
		return this.color_;
	}
	set color(color) {
		this.color_ = color;
		SetPlayerColor(this.id,this.colour_);
	}
	getDistanceFromPoint(point) {
		if(Array.isArray(pos)) return GetPlayerDistanceFromPoint(this.id,point[0],point[1],point[2]);
		else return GetPlayerDistanceFromPoint(this.id,point.x,point.y,point.z);
	}
	get keys() {
		var keys = GetPlayerKeys(this.id);
		return keys.keys;
	}
	get arrowKeys() {
		var keys = GetPlayerKeys(this.id);
		return {updown: keys.updown, leftright: keys.leftright};
	}
	get lastShotVectors() {
		var vectors = GetPlayerLastShotVectors(this.id);
		return {origin: {x: vectors.fOriginX, y: vectors.fOriginY, z: vectors.fOriginZ},
				hitPos: {x: vectors.fHitPosX, y: vectors.fHitPosY, z: vectors.fHitPosZ}};
	}
	get money() {
		this.money_ = GetPlayerMoney(this.id);
		return this.money_;
	}
	set money(money) {
		var currentMoney = this.money;
		this.money_ = money;
		this.giveMoney(money - currentMoney);
	}
	giveMoney(money) {
		this.money_ += money;
		GivePlayerMoney(this.id,money);
	}
	resetMoney(money) {
		this.money_ = 0;
		ResetPlayerMoney(this.id);
	}
	get score() {
		this.score_ = GetPlayerScore(this.id);
		return this.score_;
	}
	set score(score) {
		this.score_ = score;
		SetPlayerScore(this.id,this.score_);
	}
	get skin() {
		this.skin_ = GetPlayerSkin(this.id);
		return this.skin_;
	}
	set skin(skin) {
		this.skin_ = skin;
		SetPlayerSkin(this.id,this.skin_);
	}
	get state() {
		this.state_ = GetPlayerState(this.id);
		return this.state_;
	}
	get wantedLevel() {
		this.wantedLevel_ = GetPlayerWantedLevel(this.id);
		return this.velocity_;
	}
	set wantedLevel(wantedLevel) {
		this.wantedLevel_ = wantedLevel;
		SetPlayerWantedLevel(this.id,this.wantedLevel_);
	}
	get velocity(){
		var vel = GetPlayerVelocity(this.id);
		this.velocity_ = {x: vel.x, y: vel.y, z: vel.z};
		return this.pos_;
	}
	set velocity(vel){
		if(Array.isArray(vel)) {
			this.velocity_.x = vel[0];
			this.velocity_.y = vel[1];
			this.velocity_.z = vel[2];
		} else {
			this.velocity_.x = vel.x;
			this.velocity_.y = vel.y;
			this.velocity_.z = vel.z;
		}
		SetPlayerVelocity(this.id,this.velocity_.x,this.velocity_.y,this.velocity_.z);
	}

	set vehicle(vehicleid){
		RemovePlayerFromVehicle(this.id);
		PutPlayerInVehicle(this.id, vehicleid, 0);
	}

	get vehicle(){
		return GetPlayerVehicleID(this.id);
	}

	valueOf(){
		return this.id;
	}
};

/**
 * Holder for all Players on the server
 * 
 * @example 
 * // $players is an instance of Players
 * $players = new Players();
 * 
 * for(let id in $players){
 *    let player = $players[id];
 *    print(player.name);
 * }
 * 
 * // Gets player id 2
 * print($players[2].name);
 */
export class Players {
/**
 * Gets a player by id
 * @param   {Number} playerid Players sa-mp id
 * @returns {Player} Player object
 */
	getPlayer(playerid){
		return this[playerid];
	}
	
/**
 * Adds a new player - Internal use only
 * @param   {Number} playerid Players sa-mp id
 * @returns {Player} Player object
 */
	addPlayer(playerid){
		if(this[playerid]) return this[playerid];
		var player = new Player(playerid);
		this[playerid] = player;
		return player;
	}

/**
 * Removes a player - Internal use only
 * @param   {Number} playerid Players sa-mp id
 * @returns {Player} Player object
 */
	removePlayer(playerid){
		var player = this.getPlayer(playerid);
		delete this[playerid];
		return player;
	}

/**
 * Returns the total amount of players
 * @returns {Number} Amount of connected players
 */
	length(){
		return Object.keys(this).length;
	}
};

